       (_binary '� �]���^�\�J\0�',
        'Cuốn sách này tập hợp những bài viết mà chúng tôi cho là tốt và tiêu biểu cho ngòi bút Phạm Quỳnh, hầu hết đã in trên Nam Phong, nhằm cung cấp cho bạn dọc rộng rãi một mảng tư liệu lâu nay còn chìm khuất. Có thể ở một số luận điểm chúng ta còn chưa đồng tình với tác giả, có thể tính thời sự ở một số bài giờ đã qua đi, văn phong đầu thế kỉ cũng đôi khi gây khó khăn cho việc tiếp thu, song chắc chắn qua tập sách này, bạn dọc sẽ thấy rõ hơn được phần nào trạng thái tư tưởng và học thuật ở buổi giao thời Á Âu, thấy được phương diện học giả của ông chủ bút Nam Phong Tạp chí.',
