       (_binary '� �]���^�\�\0�',
        '1. Hiện nay những vấn đề về logic chiếm một địa vị quan trọng trong những vấn đề nghiên cứu của triết học. Điều đó này sinh do sự phát triển như vũ bão của khoa học và kỹ thuật trong cuộc cách mạng khoa học kỹ thuật lần thứ hai của loài người - cuộc cách mạng tự động hóa.\n\nLịch sử các khoa học đã phát triển với khối lượng kiến thức vô cùng to lớn, trong đó có những sáng tạo phát minh xuất hiện một cách độc lập cùng một lúc ở những nơi khác nhau. Một vấn đề được đặt ra vì sao con người có sức mạnh trí tuệ như vậy và bằng cách nào con người có thể đi đến chân lý. Một ngành khoa học được xây dựng có nhiệm vụ trực tiếp trả lời hai câu hỏi trên đó : đó là logic học.\n\n2. Logic học là một khoa học có tính đảng. Nó không bao giờ đứng ngoài các cuộc đấu tranh triết học. Trong cuộc đấu tranh này các nhà triết học duy vật đã xây dựng hệ thống logic từ logic cổ điển, logic hình thức đến logic biện chứng. Logic học đã góp phần khẳng định con người có thể nhận thức được thế giới, con người có thể tiến đến chân lý về thế giới.\n\n3. Logic khoa học ra đời vào thế kỷ 4 trước công nguyên \n\nNhà sáng lập là nhà triết học cổ Hy Lạp Aritstôt (384-322 trước công nguyên). Ông đã phát hiện được những hình thức và quy luật về kết cấu của suy nghĩ. Ông sắp xếp những tri thức đó một cách hệ thống, có lý lẽ, trình bày thành những quy tắc của suy nghĩ. Ông là người đầu tiền phát biểu các quy luật cơ bản của logic hình thức, tìm ra các hình thức của tư duy như khái niệm, phán đoán, các qui luật của tư duy như suy lý, chứng minh.\n\n4. Sự phát triển của logic học gắn liền với sự phát triển của khoa học thực nghiệm, kỹ thuật thực nghiệm khoa học và tri thức về các khoa học khác. Logic học ở thời kỳ này gọi là logic hình thức. Người có nhiều công lao động góp cho sự phát triển của logic hình thức là nhà triết học Anh P.Bécơn (1561-1626), nhà toán học và triết học Pháp R. Đề các (1596-1650), nhà toán học Đức Lépnit (1646-1716).',
        'Giáo trình Logic hình thức',
