       (_binary '� �]���^��-\0�',
        'Tác phẩm Đạo đức học Đông phương là một tác phẩm giáo khoa, nhưng nó đồng thời cũng là một đóng góp vào nỗ lực chung để làm sáng tỏ kết điểm ấy vậy.\n\nLối nhìn vấn đề của tác giả có thể sẽ làm một số độc giả ngỡ ngàng. Sự ngỡ ngàng ấy sẽ không còn nữa, khi độc giả nhớ lại tác giả còn là một nhà thơ, và nhất là một người hành động. Đạo đức không phải là điều để mà nói, mà là điều để làm, để mà lựa chọn. Lối lựa chọn của tác giả thật là phóng khoáng. Điều này có lẽ đã giải thích tại sao tác giả tránh không đưa ra một phần kết luận thông thường như bao nhiêu tác phẩm khác.',
