        'Cuốn \"Thiết bị kỹ thuật trong kiến trúc công trình\" sẽ để cập những vấn đề cơ bản nhất về các hệ thống trang thiết bị kỹ thuật công trình nhằm phục vụ các kiến trúc sư, các sinh viên chuyên ngành kiến trúc và xây dựng để tham khảo trong quá trình nghiên cứu thiết kế.',
