       (_binary '� �]���^�\0\0\0�',
        'Có nhiều cách tìm hiểu về đời sống và vũ trụ : hoặc bằng khoa học, triết học, tôn giáo, mê tín v.v... Các nhà triết gia, bác sĩ, thi sĩ... dựa vào sự hiểu biết chuyên môn có khi rơi vào tính cách chủ quan ví như thầy bói mù sờ voi đưa ra phán đoán cục bộ. Chẳng hạn người giáo sĩ sờ chân voi rồi cho rằng con voi là một khúc cây, thi sĩ sờ voi lại thi vị nó rằng cuộc đời như tàu lá sen, bác sĩ sờ phải ngà rồi kết luận cuộc đời này như khúc xương. Và rồi quan niệm về cuộc sống cứ theo đà diễn tiến chi đưa ra được những kết luận phiến diện, khó mà đạt được tổng thể của vũ trụ và nhân sinh.\n\nCá nhân tôi có thể cũng chỉ là một trong những người mù nêu trên. Tuy nhiên kiến thức của tôi xuất phát từ Á Đông nơi phát sinh ra những học thuyết uyên thâm. Trong đó phong thủy là môn bí hiểm nhưng lại rất thực tiền.',
