        'Phần mềm AutoCAD dùng để thiết kế các bản vẽ hai chiều (2D) và các bản v ba chiều (3D). Chính vì vậy phần mềm AutoCAD được sử dụng rộng rãi trên toàn thế giới, phục vụ đắc lực cho các cán bộ kỹ thuật, kiến trúc sư, các nhà thiết kể, các học viên, sinh viên của các Trường Đại học, Cao đẳng và Trung cấp Kỳ thuật... trong việc thực hiện ý tưởng và thể hiện tiếng nói của mình qua bản vẽ.\nPhần mềm AutoCAD chỉ là công cụ hỗ trợ việc thực hiện các bản vẽ kỹ thuật thông qua máy tính. Còn vấn đề chính yếu vẫn là kiến thức về chuyên môn, nắm rõ các tiêu chuẩn về thể hiện bản vẽ ứng với từng chuyên ngành cụ thể cùng với các ý tưởng phân tích tạo hình biểu diễn các hình vẽ,\nSách \"Sử dụng AutoCAD 2012\" được biên soạn hưởng đến các đối tượng từ lúc mới bắt đầu học hoặc tự học cho đến mức độ chuyên nghiệp. Việc trình bày ngắn gọn, rõ ràng, đầy đủ nội dung cùng với các ví dụ minh họa cho từng lệnh và bài tập cuối chương sẽ giúp người đọc nhanh chóng nắm được các vấn đề.',
