        'Cuốn \"Cấu tạo kiến trúc\" là tập cuối của bộ sách \"Nguyên lý thiết kế kiến trúc dân dụng\". Nội dung này là kiến thức cơ bản chuyên môn của tất cả những ai làm công tác xây dựng cơ bản, từ người kỹ sư công trình, kiến trúc sư hay người giám sát xây dựng cho đến các chuyên gia quản lý các dự án xây dựng cơ bản, vì thế luôn chiếm một vị trí quan trọng trong cơ cấu hệ thống giáo trình đào tạo của các Trường Đại học Kiến trúc và Xây dựng. Trên thực tế, các giáo trình này còn được xem như những cẩm nang tham khảo cần thiết và bổ ích cho những ai quan tâm đến xây dựng mới hay tôn tạo sửa chữa nhà cửa. Cấu tạo kiến trúc vì thường gắn liền với vật liệu mới và tiến bộ khoa học kỹ thuật của ngành nên việc biên soạn rất khó khăn và rất khó cập nhật, thỏa mãn đầy đủ đòi hỏi của thực tế xây dựng ở mọi nơi, mọi lúc... vì vậy các tài liệu đã xuất bản thường là dưới dạng chủ yếu giới thiệu các chi tiết cấu tạo cụ thể để tham khảo...',
