        'Trong vài thập kỷ qua cùng với sự phát triển mạnh mẽ của kỹ thuật xử lý tín hiệu số (DSP) và các mạch điện tử số tích hợp cỡ lớn (VLSI), kỹ thuật truyền tin số cũng đồng thời phát triển. Với nhiều ưu điểm nổi trội về khả năng chống nhiễu, về độ tin cậy cũng như tính mềm dẻo trong thiết kế ứng dụng, truyền tin số đang dần thay thế kỹ thuật truyền tin tương tự đã một thời phát triển rực rỡ.\n\nMặc dù có nhiều tính chất tương đồng như kỹ thuật tương tự, song kỹ thuật truyền tin số vẫn được coi như có cơ sở lý thuyết riêng với những nét đặc thù đặc sắc của nó. Tài liệu này cung cấp những kiến thức thiết yếu làm cơ sở cho việc thiết kế xây dựng một hệ truyền tin số dùng cho sinh viên ngành Điện tử – Viễn thông sau khi đã có các kiến thức về Tin hiệu và hệ thống, Xử lý tín hiệu số. Xác suất và quá trình ngẫu nhiên.',
