        '“Toán rời rạc cho kỹ thuật số là tài liệu đúc kết những thành tựu nghiên cứu cơ bản về lí thuyết tập hợp, tổ hợp, lí thuyết đồ thị và đại số. Nội dung cuốn sách được chia thành mười chương. Từ chương I đến chương IX cung cấp cho bạn đọc những kiến thức cơ bản về lí thuyết tập hợp, tổ hợp và cấu trúc đại số; đặc biệt đi sâu về đại số logic, đại số chuyển mạch vector theo quan điểm hiện đại. Chương cuối cùng (chương X) giới thiệu tổng quát nhất về lí thuyết nhóm, vành và trường nhằm tạo cơ sở cho những độc giả muốn đi sâu hơn về lĩnh vực toán ứng dụng. Sau mỗi chương đều có các bài tập để bạn đọc tự kiểm tra lại kiến thức của mình.',
