        'Cuốn sách không chỉ là một tài liệu khoa học mà còn là một mong muốn được chia sẻ, cảm thông của các người tạo lập với cộng đồng người khiếm thị Việt Nam. Cuốn sách là sản phẩm kế tiếp chuỗi sản phẩm mà các người tạo lập đã thực hiện dành cho người khiếm thị (người mù, người mù màu, người thị lực kém). Nội dung cuốn sách là một tài liệu hướng dẫn cụ thể và sinh động phục vụ cho những người lập trình và quản trị web có mong muốn xây dựng website cho người khiếm thị. Các người tạo lập đã trình bày chi tiết về các đặc trưng cơ bản của website dễ tiếp cận, chỉ ra các yếu tố trong thiết kế làm cho người khiếm thị gặp khó khăn trong quá trình tiếp cận. Từ đó các người tạo lập định hướng tạo lập các website dựa trên các chuẩn như Luật Công nghệ thông tin Việt Nam, Luật Người khuyết tật Việt Nam, các luật trên thế giới, các tiêu chuẩn xây dựng, đánh giá, các hướng dẫn và khuyến nghị. Cuốn sách chỉ ra mô hình thiết kế nội dung web dễ tiếp cận dành cho người khiếm thị và ứng dụng thực tiễn, đồng thời cũng chỉ ra một số quy trình thiết kế thiết kế lại web site một cách hiệu quả, cũng như các công cụ tiện ích chuyên dụng cho các công việc này.',
