       (_binary '� �]���^�b\�\0�',
        'Ngày nay, khi Internet đã trở nên quen thuộc và gần gũi với mọi người, thậm chí là công cụ không thể thiếu trong đời sống hiện đại thì việc đưa thông tin quảng bá, tìm kiếm thông tin, giao dịch mua bán trên Internet... là những hoạt động thường xuyên của các cư dân trên mạng. Chính vì vậy nhu cầu thiết kế được những trang Web hấp dẫn, thu hút nhiều người truy cập là mục tiêu và mơ ước của nhiều người.\n\nXuất phát từ nhu cầu đó, cuốn sách trước hết sẽ cung cấp cho người đọc những kiến thức cơ bản nhất, hiểu được cấu tạo và cách thiết kế một trang Web đơn giản. Bên cạnh đó là những lời khuyên để giúp bạn đọc - những người mới bước chân vào thế giới Web chưa có kinh nghiệm, có được định hướng để tạo ra được những trang Web có giao diện đẹp, phù hợp với tiêu chí, mục đích của trang Web và thu hút được người xem.\n\nĐồng thời cuốn sách cũng cung cấp cho các bạn sinh viên kiến thức về Thương mại điện tử, hiện đang là một trong những phương thức kinh doanh mang lại nhiều lợi ích cho nhân loại và là phương thức kinh doanh đại diện cho nền kinh tế tri thức. Sau khi đã nắm được những kiến thức về lập trình Web, bạn đọc có thể dùng công cụ hỗ trợ để làm việc hiệu quả hơn.\n\nGiáo trình Thiết kế Web được sử dụng cho việc giảng dạy và học tập của giảng viên và sinh viên các trường Cao đẳng và Trung cấp chuyên nghiệp.',
