        'Từ tháng 9 năm 2001 Bộ Giao thông vận tải đã ban hành Tiêu chuẩn thiết kế cầu mới mang ký hiệu 22TCN 272-01. Tiêu chuẩn này đã được áp dụng thử nghiệm và sẽ được áp dụng chính thức từ năm 2005 để thiết kế tất cả các cầu đường ôtô trên toàn quốc.\n\nTiêu chuẩn này cho phép sử dụng mô hình giàn ảo hay còn gọi là mô hình chống và giằng để tỉnh toán kết cấu bê tông cốt thép. Để giúp bạn đọc làm quen với nội dung của phương pháp mới này, chúng tôi biên soạn cuốn \"Tính toán Kết cấu bê tông cốt thép theo mô hình giàn ảo\"; cuốn sách như một tài liệu tham khảo dành cho các kỹ sư cầu đường và các sinh viên của chuyên ngành đào tạo kỹ sư cầu đường.',
