        'Lý thuyết bê tông là một trong hai phần liên quan chặt chẽ với nhau của giáo trình Công nghệ các sản phẩm đúc sẵn bằng bê tông và bê tông cốt thép. Nó nghiên cứu các dạng bê tông khác nhau, thành phần cấu tạo, tính chất của chúng và những nhân tố quyết định những tính chất này.\n\nViệc nghiên cứu lý thuyết bê tông nhằm mục đích tìm hiểu tính chất và yêu cầu kỹ thuật của nguyên liệu, tỷ lệ phối hợp hợp lý giữa chúng, nguyên lý rắn chắc và phát triển cường độ của các loại bê tông và các biện pháp cải thiện tính năng kỹ thuật của chúng phù hợp với yêu cầu của công nghệ thành hình cấu kiện và điều kiện sử dụng.\n\nTrong phạm vi giáo trình này chỉ nghiên cứu các loại bê tông chế tạo từ các chất kết dính vô cơ như xi măng, või silíc, các loại xì quặng, thạch cao...\n\nGiáo trình này dùng cho sinh viên đại học ngành Công nghệ vật liệu và cấu kiện xây dựng, ngoài ra còn dùng làm tài liệu tham khảo cho sinh viên các ngành khác cần hiểu biết sâu hơn về vật liệu bê tông.',
