        'Cuốn giáo trình \"KỸ THUẬT THỰC HÀNH NGUỘI\" được viết với sự hỗ trợ của chuyên gia Nhật Bản là một trong những hoạt động của Dự án, Giáo trình giới thiệu các kiến thức cá sử về thực hành nguội gia công cơ khí băng tay, làm nên mông cho các môn học thực hành khác thuộc lĩnh vực gia công cơ khí. Đây còn là một tài liệu tham khảo bỏ ích cho các giáo viên ở các trường dạy nghé. Giáo trình bao gồm 2 phần:\n\nPhần 1: Các công nghệ cơ bản về gia công cơ khí nguội\n\nPhần 2: Bài tập tổng hợp theo tiêu chuẩn Nhật bản\n\nGiáo trình được hoàn thành do tập thể các đối tác Việt Nam thuộc hau gia công cơ khí và được sự giúp đỡ nhiệt tình của ngài chuyên gia Shinichi KITANO Nhật Bản.',
