       (_binary '� �]���^��\�\0\�',
        'Giáo trình được biên soạn theo để cương do Vụ THCN-DN, Bộ Giáo dục và Đào tạo xây dựng và thông qua. Nội dung được biên soạn theo tinh thần ngắn gọn, dễ hiểu. Các kiến thức trong toàn bộ giáo trình có mối liên hệ lôgíc chặt chẽ. Tuy vậy, giáo trình cũng chỉ là một phần trong nội dung của chuyên ngành đào tạo cho nền người dạy, người học cần tham khảo thêm các giáo trình có liên quan đối với ngành học để việc sử dụng giáo trình có hiệu quả hơn.\n\nKhi biên soạn giáo trình, chúng tôi đã cố gắng cập nhật những kiến thức mới có liên quan đến môn học và phù hợp với đối tượng sử dụng cũng như cố gắng gắn những nội dung lí thuyết với những vấn đề thực tế thường gặp trong sản xuất, đời sống để giáo trình có tính thực tiễn.',
