       (_binary '� �]���^�\�\0\�',
        'Máy phay chiếm một phần lớn trong các loại máy cắt kim loại. Trên các máy phay có thể thực hiện được nhiều công việc khác nhau. Kết cấu của máy phay không ngừng được cải tiến. Do đó mang suất, độ chính xác, độ bền và tuổi thọ của máy cũng không ngừng được tăng lên. Năng suất của máy phay có thể tang được bằng cách tang công suất và hành trình chạy nhanh của tờ cầu chuyển động chính, mở rộng phạm vi điều chỉnh tốc độ và lượng chạy dao, tự động hóa chu kỳ gia công, tự động hóa và cơ khí hóa các chuyển động phụ, sử dụng các đồ gá vạn năng và chuyên dùng. Độ chính xác, độ bầu vững và tuổi thọ của máy phay tăng lên là do các chi tiết và các đơn vị lắp ráp chính xác hơn, độ cứng vững của máy tăng lên, sử dụng cơ cấu điều chỉnh tự động, phương pháp bôi trơn v.v...\n\nGần đây số lượng các máy phay điều khiển theo chương trình số (máy CNC) và các trung tâm gia công được sản xuất tang lên, góp phần nâng cao hiệu quả gia công, đặc biệt là trong sản xuất hàng loạt vừa và hàng loạt nhỏ.\n\nNội dung được trình bày trong sách giáo khoa này đáp ứng được yêu cầu của chương trình đào tạo thợ phay và giáo viên dạy nghề trong lĩnh vực này ở các trường kỹ thuật chuyên nghiệp. Cuốn sách còn có thể làm tài liệu tham khảo cho sinh viên cơ khí, thợ điều chỉnh máy phay thợ phay dang làm việc ở nhà máy và các kỹ sư công nghệ.',
