        'Lắp ráp điện tử (electronic assembly) ở Việt Nam là một ngành không mới, bởi nó có bề dày lịch sử hơn 30 năm. Nói đến công nghệ lắp ráp điện tử thì ai ai cũng có thể nhận ra các sản phẩm tiêu dùng quanh chúng ta ngày nay đều hầu như có sự hiện diện của nó, nhưng nói về cách lắp ráp để có được một sản phẩm điện tử thì ngay cả các kỹ sư chuyên ngành điện tử ở các trường đại học lớn ở Việt Nam cũng còn chưa thực sự rõ hết.\n\nTham gia ngành lắp ráp điện tử cũng là một nghề có rất nhiều cơ hội phát triển ở Việt Nam, vì hiện nay nhiều tập đoàn điện tử nổi tiếng trên thế giới chọn Việt Nam làm nơi lắp ráp, đó là lí do một kỹ thuật viên có kinh nghiệm về lắp ráp điện tử công nghiệp luôn có cơ hội về công việc cũng như mức thu nhập dồi dào.',
