        '<h2>Cuốn sách huyền thoại Giải thích ngữ pháp tiếng Anh của Mai Lan Hương. </h2><h2>Giải thích ngữ pháp cực kỳ chi tiết và đầy đủ, kèm theo bài tập đa dạng để ôn luyện.</h2><p>Link: <a href=\"https://drive.google.com/file/d/1OdlQfln39nnn_RiZJpLlsUqozgvPsRCB/view?usp=drive_link\" rel=\"noopener noreferrer\" target=\"_blank\">GTNPTAMLH</a></p><p><img src=\"https://drive.google.com/thumbnail?id=1cCwWJd3EkdWn-TgbFEZmFhm0YNs9Nu3a\"></p>',
