       (_binary '��\0e�<\�<��S\0�', '2024-05-03 10:36:40.275000', 'Cảm nhận về hai cuốn sách Machine Learning hot',
        NULL, _binary '����\� ��\�17�\0',
        '<h2>Machine Learning with Python Cookbook: Practical Solutions from Preprocessing to Deep Learning</h2><p><img src=\"https://m.media-amazon.com/images/I/61JhQgL86KL._SL1020_.jpg\"></p><p>Hướng dẫn bạn một cách thực tế này cung cấp gần 200 công thức độc lập để giúp bạn giải quyết những thách thức về máy học mà bạn có thể gặp phải trong công việc hàng ngày. Nếu bạn cảm thấy thoải mái với Python và các thư viện của nó, bao gồm gấu trúc và scikit-learning, bạn sẽ có thể giải quyết các vấn đề cụ thể như tải dữ liệu, xử lý dữ liệu văn bản hoặc số, lựa chọn mô hình, giảm kích thước và nhiều chủ đề khác.</p><p><strong>Bạn sẽ học được gì?</strong></p><ul><li>Vectơ, ma trận và mảng</li><li>Xử lý dữ liệu số và phân loại, văn bản, hình ảnh, ngày và giờ</li><li>Giảm kích thước bằng cách sử dụng trích xuất đối tượng hoặc lựa chọn đối tượng địa lý</li><li>Đánh giá và lựa chọn mô hình</li><li>Hồi quy tuyến tính và logic, cây và rừng, và k-láng giềng gần nhất</li><li>Hỗ trợ máy vectơ (SVM), Bayes ngây thơ, phân cụm và mạng nơ-ron</li><li>Lưu và tải các mô hình được đào tạo</li></ul><h2>Practical Machine Learning and Image Processing_ For Facial Recognition, Object Detection, and Pattern Recognition Using Python</h2><p><img src=\"https://m.media-amazon.com/images/I/71JcDfEGwEL._SL1254_.jpg\"></p><p>Bạn sẽ biết được tất cả các khái niệm trong Học máy thực tế và Xử lý hình ảnh được giải thích bằng cách sử dụng các tình huống thực tế. Sau khi đọc cuốn sách này, bạn sẽ có thể áp dụng các kỹ thuật xử lý hình ảnh và tạo các mô hình học máy cho các ứng dụng tùy chỉnh.</p><p><strong>Bạn sẽ học được gì?</strong></p><ul><li>Khám phá các thuật toán xử lý hình ảnh và các ứng dụng của chúng bằng Python</li><li>Khám phá xử lý hình ảnh bằng thư viện OpenCV</li><li>Sử dụng TensorFlow, scikit-learning, NumPy và các thư viện khác</li><li>Làm việc với các thuật toán học máy và học sâu để xử lý hình ảnh</li><li>Áp dụng các kỹ thuật xử lý hình ảnh cho năm dự án thời gian thực</li></ul><p><br></p><p><br></p>',
        19, _binary '��\0f�������\�8\0', _binary '����P���\0\�\0'),
       (_binary '��\0e�<\�<��\�\0�', '2024-05-03 10:36:42.702000', 'Kinh nghiệm làm khóa luận tốt nghiệp', NULL,
        _binary '����\� ��\�15\0',
        '<p>Sau khi vượt qua những năm Đại học cam go, bạn sẽ đến với chặng cuối cùng: KHÓA LUẬN TỐT NGHIỆP. Đây là cơ hội rất tốt để các bạn Sinh viên được làm quen, được tập nghiên cứu, được học cách làm một công trình khoa học, được áp dụng tất cả những kiến thức đã học vào việc thực hiện một đề tài cụ thể.</p><p>Đành rằng, làm khóa luận cũng có nghĩa là vất vả cực nhọc suốt mấy tháng ròng, song cái mà bạn thu được sẽ là thành quả xứng đáng với những gì bạn bỏ công, mất sức.</p><p><br></p><p><img src=\"https://fem.tlu.edu.vn/Portals/0/tot%20nghiep%203_1.jpg\"></p><p><br></p><p>1. Tìm đề tài</p><p><br></p><p>Khi biết mình nằm trong danh sách các Sinh viên được làm khóa luận/đồ án tốt nghiệp (được làm chứ không phải là phải làm đâu nhé), có người giật mình vì không biết chọn đề tài nào đây. Đề tài khóa luận tốt nghiệp của Sinh viên có thể do khoa, bộ môn gợi ý, nhưng cũng có thể do Sinh viên đề xuất. Dù thế nào thì bạn cũng phải chuẩn bị trước ý tưởng về những vấn đề mình quan tâm, ham thích, có hứng thú và có khả năng tìm hiểu. Những ý tưởng này có thể hình thành ngay từ những năm thứ hai, thứ ba, để rồi bạn có ý thức tìm kiếm tư liệu, tìm đọc các bài viết liên quan, như vậy bạn sẽ bớt hoang mang, bối rối khi đứng trước hàng loạt các đề tài (cho sẵn) hay trước mênh mông các vấn đề (cần nghĩ để đề xuất).</p><p><br></p><p>Sinh viên Đại học có tâm lý tìm kiếm một đề tài nào đó to tát, có tên nghe thật kêu. Có thể họ cho rằng phải như thế mới xứng tầm đề tài khóa luận tốt nghiệp chăng? Không phải thế đâu. Ở bậc cử nhân, các bạn nên chọn giải quyết một khía cạnh, một vấn đề nhỏ thôi, càng cụ thể càng tốt. Bạn có thể đem những băn khoăn của mình đi hỏi các thầy cô giáo (tốt nhất là các thầy cô có chuyên môn sâu ở lĩnh vực bạn cần tham vấn), bạn sẽ nhận được những lời khuyên hữu ích.&nbsp;</p><p><br></p><p>2. Thực hiện đề tài</p><p><br></p><p>Lẽ dĩ nhiên, không phải nhận đề tài về rồi là bạn bắt tay vào viết được đâu. Muốn viết được, bạn phải chuẩn bị đầy đủ các dữ kiện.</p><p><br></p><p>Trước hết bạn nên dành thời gian để đọc. Tại sao ư? Bạn cần tìm đọc các tài liệu, công trình, bài viết liên quan trực tiếp, gián tiếp đến đề tài, để biết được những người đi trước đã khai thác vấn đề đến đâu, đã đạt được kết quả gì, vẫn còn điều gì chưa được đề cập hoặc giải quyết chưa thấu đáo. Như vậy bạn sẽ hình dung được điều mình làm là gì và không lặp lại những gì người khác đã làm. Nhờ đó, bạn bắt đầu hình thành một đề cương để thảo luận với thầy hướng dẫn. Bạn cũng cần biết rằng, toàn bộ những tài liệu đã đọc ấy sẽ giúp bạn viết nên mục lịch sử nghiên cứu vấn đề, nằm ở phần Mở đầu của khóa luận.</p><p><br></p><p>Sau khi thảo luận với thầy hướng dẫn và được thầy góp ý, gợi mở, bạn đã có trong tay đề cương chi tiết của khóa luận. Đề cương này cũng có thể còn thay đổi: thu hẹp hoặc mở rộng, tùy thuộc vào nguồn tư liệu và kết quả khảo sát tư liệu trong quá trình thực hiện. Đây là chuyện thường thấy.</p><p><br></p><p>Cấu trúc chung của một khóa luận tốt nghiệp (của cả luận văn thạc sĩ, luận án tiến sĩ) là gồm ba phần: Mở đầu (Dẫn nhập), Các chương, Kết luận. Tuần tự như tiến, không ít bạn sẽ bắt tay viết phần Mở đầu trước.</p><p><br></p><p>Không sao cả. Nhưng bạn có biết rằng bạn không cần bắt đầu với Mở đầu không? Hãy để đến khi hoàn tất các chương chính của khóa luận, bạn viết Mở đầu cũng không muộn, đấy là chưa nói, có thể đó là cách làm khôn ngoan, vì bạn sẽ mô tả chính xác hơn những gì khóa luận đã thực hiện, những kết quả khóa luận đã đạt được.&nbsp;</p><p><br></p><p>Bạn đừng ngại tiếp xúc với giáo viên hướng dẫn. Hãy dũng cảm nói để thầy cô biết điều mình không biết, chưa hiểu, lúng túng. Đừng giữ nỗi lo trong lòng, đừng giấu dốt. Vì là lần đầu tiên làm nghiên cứu, bao nhiêu là điều mới lạ, nên bạn có thể hiểu hết ngay mọi chuyện mới là… không bình thường. Hãy học hỏi chân thành, với thái độ cầu thị, thầy cô sẽ chỉ cho bạn cần bắt đầu từ đâu, lấy tư liệu thế nào, xử lý ra sao. Tỉ mỉ, từng bước một. Thầy cô là người hướng dẫn mà! Nhưng bạn cũng nhớ hết sức cố gắng, tự giác và chủ động làm việc, chứ đừng ỷ lại. Chính bạn là người thực hiện công trình, chứ không ai khác.</p><p><br></p><p>3. Trình bày khóa luận</p><p><br></p><p>Các bạn không cần băn khoăn tự hỏi phải trình bày khóa luận ra sao, vì bạn đã có cẩm nang hướng dẫn trình bày hình thức khóa luận/đồ án tốt nghiệp do trường, khoa hoặc bộ môn đào tạo cung cấp. Từ cách trình bày trang bìa, trang bìa trong, phông chữ, cỡ chữ…, đến nguyên tắc dãn dòng, canh lề, đánh số trang, chú thích… mọi chi tiết đều được chỉ dẫn rõ ràng. Một khóa luận có hình thức trình bày đúng chuẩn bao giờ cũng chiếm được cảm tình của người đọc ngay từ trang đầu tiên. Nhớ kiểm tra kỹ từng trang để đảm bảo không còn sót lỗi chính tả, lỗi ngữ pháp, lỗi diễn đạt… Mấy “chuyện nhỏ” ấy có thể lấy đi của bạn số điểm đáng kể đấy.&nbsp;</p><p><br></p><p>Trong từng chương, bạn nên đặt tên các mục, tiểu mục một cách có hệ thống và đánh số thứ tự cho các tiêu đề. Thông thường, ở các trường kỹ thuật, cách đánh số Ả Rập, theo ma trận (nhiều nhất là đến bốn chữ số) sẽ được ưa chuộng hơn.&nbsp;</p><p><br></p><p>Tuy nhiên, cũng có những trường sẽ hướng dẫn cách đánh số thứ tự tiêu đề theo số La Mã và chữ cái.</p><p><br></p><p>Cách nào cũng thể hiện được tính hệ thống cả bạn ạ. Miễn là bạn làm đúng theo quy định về định dạng báo cáo của trường bạn. Nếu trường bạn không có quy định cụ thể thì bạn có thể lựa chọn một trong hai cách trên.</p><p><br></p><p>Ngoài ra, cũng nên chú ý viết mấy dòng mở đầu chương (gọi là Tiểu dẫn) và kết chương (gọi là Tiểu kết), như vậy bố cục của chương sẽ rất chặt chẽ. Bố cục này bạn sẽ còn sử dụng về sau, nếu bạn có cơ hội làm luận văn cao học, luận án tiến sĩ. Vậy hãy tập cách làm việc chuyên nghiệp này ngay từ bây giờ bạn nhé.</p><p><br></p><p>4. Thuyết trình trước hội đồng</p><p><br></p><p>Sau bao nhiêu ngày tháng vất vả, giờ bạn đã có trong tay khóa luận/đồ án tốt nghiệp để trình lên hội đồng giám khảo. Nỗi lo đã vơi đi, nhưng vẫn còn một cửa ải cuối cùng phải vượt qua. Làm thế nào để có một buổi bảo vệ thành công?&nbsp;</p><p><br></p><p>a. Chuẩn bị kỹ càng</p><p><br></p><p>Một sự chuẩn bị chu đáo bao giờ cũng quyết định 80% thành công. Bạn hãy tận dụng sự trợ giúp từ các slide trình chiếu, nhưng đừng lạm dụng. Các slide nên trình bày đơn giản (không rối rắm màu sắc, trừ phi đồ án của bạn cần thể hiện một kết quả nào đó liên quan nhiều đến màu sắc, đường nét, hình họa; không chen hình hoa lá, thú vật nhảy nhót), ít chữ, chữ cỡ lớn để dễ nhìn, không chọn những màu chữ quá chói (vàng cam, nõn chuối) hoặc quá nhạt. Các slide trình chiếu tuyệt đối không thể là kết quả của công đoạn “chép và dán” từ văn bản soạn trong chương trình Microsoft Word. Cần cân nhắc lựa chọn nên trình chiếu nội dung gì và thể hiện nó một cách gọn ghẽ thành các ý, chứa trong đó một câu hay một ngữ (chứ không phải một đoạn!). Những ý nêu lên chỉ là cái khung gợi ý để bạn thuyết minh thêm, chứ chúng không làm thay phần trình bày của bạn.</p><p><br></p><p>Bạn nên chuẩn bị trước một số tư liệu, sách báo, băng đĩa, hình ảnh… liên quan đến quá trình thực hiện khóa luận/đồ án. Đó sẽ là những minh chứng cần thiết khi giám khảo yêu cầu.</p><p><br></p><p>Bạn cần hiểu rõ những gì bạn đã làm được, và cả những gì bạn chưa thật hài lòng, hay chưa kịp thực hiện trong khóa luận. Điều đó sẽ khiến bạn tự tin với thành quả, đồng thời có một thái độ tự chủ, sẵn sàng lắng nghe những góp ý của hội đồng giám khảo.</p><p><br></p><p>Bạn hãy chuẩn bị một sức khỏe tốt cho ngày bảo vệ. Đừng để mình kiệt sức khi “trận đấu” chưa thực sự mở màn.&nbsp;</p><p><br></p><p>b. Thái độ tự tin, đúng mực</p><p><br></p><p>Đã trải qua những ngày tháng dài làm đồ án, bạn phải là người hiểu rõ công việc của mình, chỗ mạnh, chỗ yếu của công trình. Vậy thì tại sao bạn không tự tin bước tới trình bày những gì bạn đã làm được? Sự tự tin, điềm tĩnh, đúng mực của bạn sẽ được ban giám khảo đánh giá cao.</p><p><br></p><p>c. Nói năng lưu loát</p><p><br></p><p>Đứng trước một hội đồng giám khảo gồm toàn những chuyên gia có tên tuổi, bạn bỗng “run như cầy sấy” và lúng túng nói không thành câu.</p><p><br></p><p>Đừng lo, mấy giây đó sẽ qua nhanh thôi. Hãy hít một hơi thật sâu, lấy lại bình tĩnh, chào các thành viên hội đồng và… bắt đầu. Sẽ rất hữu ích nếu bạn đã chuẩn bị trước phần thuyết minh này ở nhà bằng cách tập nói trôi chảy, không ngắc ngứ, theo thời gian quy định (thường là 10-15 phút đối với khóa luận/đồ án tốt nghiêp). Hai ba lần tập luyện như thế sẽ giúp bạn không còn lúng túng trong ngày bảo vệ.</p><p><br></p><p>d. Trình bày vấn đề và nêu bật kết quả nghiên cứu</p><p><br></p><p>Cả một công trình đồ sộ trên dưới 100 trang, kết quả của 3-4 tháng miệt mài lao động, lại chỉ được trình bày trong vẻn vẹn 10-15 phút! Bạn sẽ thấy, chao ôi, thời gian ít ỏi quá, làm sao nói cho hết. Nhưng bạn không cần “nói cho hết”, mà chỉ nhấn mạnh những điểm cần nói. Hãy dành khoảng 2 phút để nói về lý do bạn lựa chọn đề tài này, mục tiêu mà bạn đặt ra là gì, bạn đã dùng những phương pháp gì để thực hiện, trên cơ sở dữ liệu nào. Dành khoảng 1-2 phút cuối cho những kết luận khẳng định lại kết quả nghiên cứu của bạn. Thời gian còn lại, bạn hãy chọn trình bày những vấn đề cốt lõi, cơ bản của đề tài, theo một mạch dẫn liên kết chặt chẽ, có hệ thống. Đừng cố nói “tất tần tật” mọi ý tưởng, vì như thế, có thể bạn sẽ bị cắt ngang vì hết giờ, trong khi bạn còn biết bao điều chưa kịp nói.</p><p><br></p><p>e. Trả lời thuyết phục</p><p><br></p><p>Các bạn sinh viên khi lên bảo vệ có một tâm lý chung là sợ bị chất vấn, phản biện. Câu hỏi dù khó, dù dễ đều ngại trả lời, tốt nhất là cứ “cảm ơn thầy cô, em xin ghi nhận và sẽ tìm hiểu sau” cho an toàn!</p><p><br></p><p>Nếu làm như thế thì đâu còn ý nghĩa của một buổi bảo vệ khóa luận/đồ án. Với tư cách là tác giả công trình, bạn hãy sẵn sàng “đương đầu” với những câu hỏi, mà phần lớn chỉ với mục đích tạo cho thí sinh cơ hội được thể hiện những hiểu biết của mình xung quanh đề tài đã làm. Hãy cố gắng trả lời hoặc thảo luận trong chừng mực có thể, còn với những câu hỏi vượt quá khả năng trả lời, bạn hãy trung thực nói rõ, đồng thời tỏ thái độ cầu thị, thầy cô sẽ cho bạn lời giải. Và lời giải đó có thể là một gợi ý để bạn hoàn thiện đề tài hoặc mở rộng đề tài ở cấp nghiên cứu cao hơn.</p>',
        35, _binary '��\0f�������\�8\0', _binary '����P���\0\�\0'),
       (_binary '��\0e�<\�<�� \0�', '2024-05-03 10:36:43.808000', 'Review sách Chẩn Đoán Hình Ảnh hay\n', NULL,
        _binary '� �]���^\�I�6',
        '<p> <img src=\"https://drive.google.com/thumbnail?id=1h_FYtMn6COYiwhAHBR2vlEC2poBqHv4F\"></p><p> Sách được chia làm 2 hướng tiếp cập. Hướng thứ nhất đi từ lý thuyết tới hình ảnh siêu âm, hướng thứ 2 đi ngược lại hướng thứ nhất giống thực tế trong quá trình thực hành lâm sàng. </p><p>Hướng thứ 1 có 9 chương: đi từ cơ bản là giải phẫu chi trên, chi dưới, thân; tiếp theo trình bày những rối loạn, bệnh lý của các phần trên siêu âm như bệnh lý chóp xoay, bệnh lý thần kinh – mạch máu…</p><p>Hướng tiếp cận thứ 2 đi từ thực cách tiếp cận vấn đề khoảng 5 chương (thực tế khi thực hành chủ yếu mình cần cái này) . Đây là các tiếp cận không phải sách nào cũng có phần này. Mình nghĩ xu thế viết sách của các tác giả sẽ viết theo cách này. Chẳng hạn như khi bạn gặp một khối echo kém dưới da thì có khả năng là những bệnh lý gì, phân biệt nó như thế nào.</p><p> Thật ra nhiều cũng viết nội dung như thế: cái hay của sách nằm ở cách viết. Mở đầu mỗi chương là mục “Key Facts”, thực tế đọc nhiều rồi mình thấy chỉ cần nhớ phần này là đã tóm lược được tất cả nội dung chính của bài, phần này ngắn gọn, xúc tích dễ nhớ. Sau đó các mục diễn giải như tên gọi khác, mô tả hình ảnh bệnh lý trên siêu âm, có đối chiếu với Xquang, CT, MRI, chẩn đoán phân biêt, hướng xử trí và tiên lượng… Sách sử dụng vốn từ đơn giản, ngắn gọn, đặc biệt nhiều hình ít chữ (điều mà mình rất thích), xoáy sâu vào trọng tâm thực hành, thống kê từ thường gặp tới ít gặp nhưng không nặng nề về con số. Không giống mấy cuốn textbook như “DIAGNOSTIC ULTRASOUND” của tác giải Carol M. Rumack hay “CALLEN’S ULTRASONOGRAPHY IN OBSTRETRICS AND GYNECOLOGY”… mấy cuốn này mình đọc xí là buồn ngủ. </p><p> Tóm lại là sách hay, dễ đọc. Mình đang cân nhắc có thời gian thì dịch ra cho mọi người cùng đọc.</p>',
